column8:
自力での食事が困難になってしまった老犬など<br>
介護が必要なペットの食事の補助に便利です。<br><br>
フードを少しずつ食べさせてたり、混ぜ合わせたり、<br>お食事サポートなどに重宝します。<br><br>
・長いグリップで持ちやすい<br>
・ケース付きだから衛生的で、外出時にも便利<br>
・やわらか素材で、口あたりが優しい<br>
・汚れが付きにくく、お手入れ簡単<br>
・固形フード用とペースト用の２個セット<br><br>
犬 U^ェ^U　　　猫 (=^ェ^=)　　【共通】<br><br>
煮沸消毒はお避けて下さい！<br>
<br>
○商品サイズ<br>
　スプーン　150mm<br>
　ケ ー ス　165mm×70mm×15mm<br><br>
○品質表示<br>
　ケ ー ス：ポリプロピレン<br>
　スプーン持手：ポリプロピレン<br>
　スプーン先端：エラストマー<br>
○耐熱温度：120度<br>
<br><BR>

<style>
/*買い物カゴボタン*/
#rakutenLimitedId_aroundCart input {
	width: 320px;
	height: 70px;
	background:url(http://www.rakuten.ne.jp/gold/casmin/img/common/cart_in.gif) #ff8003 no-repeat;
	overflow: hidden;
	border-width: 0px;
	cursor: pointer !important;
	text-indent: 150%;
	white-space: nowrap;
	margin: 5px 0 0 0;
	display:block;
}

#rakutenLimitedId_aroundCart td.inventory {
	padding:10px 5px;
	vertical-align:middle;
	height: 2.4em;
	display:table-cell;
}

#rakutenLimitedId_aroundCart .inventory input {
	background:none !important;
	border:1px solid #cfcfcf;
	width:1.6em;
	height:1.6em;
	margin:0;
}



/*個数テキスト*/
#rakutenLimitedId_aroundCart .unit {
	font-size:16px;
}

/*個数入力*/
#rakutenLimitedId_aroundCart input#units {
	border:solid #ccc 1px;
	background:#fff!important;
	width:30px;
	height:30px;
	cursor:auto;
	padding:7px 7px 7px 3px;
	text-indent: 0px;
	overflow: hidden;
	display:inline;
	font-size:16px;
}

/*お問い合わせボタン*/
#rakutenLimitedId_aroundCart font input {
	width: 320px;
	height: 43px;
	background:url(http://www.rakuten.ne.jp/gold/casmin/img/common/contact_item.gif) #beb9b4 no-repeat;
	overflow: hidden;
	border-width: 0px;
	cursor: pointer !important;
	text-indent: 150%;
	white-space: nowrap;
	margin: 5px 0 0 0;
	display:block;
}

#serviceTableSml .favorite {
	display:block;
	width: 320px;
}

#serviceTableSml .favorite .bookmarkArea div{
	width: 320px!important;
}

#serviceTableSml .favorite .bkm a {
	width: 320px!important;
	height: 144px!important;
	background:url(http://www.rakuten.ne.jp/gold/casmin/img/common/like_item.gif) #d8fbfd no-repeat;
	overflow: hidden;
	border-width: 0px;
	cursor: pointer !important;
	text-indent:-150%;
	margin: 5px 0 0 0;
	display:block;
}

input[type="radio"] {
    border: 0px;
}

.catch_copy,
.item_name {
text-align:left;
}

.commonbig-area h3 {
	text-align:center;
}

.commonbig-area ul {
	width:730px;
	list-style:none;
	margin:0;
	padding:0;
}

.commonbig-area ul li {
	width:240px;
	float:left;
	margin:0 5px 5px 0;;
	padding:0;
}

.commonbig-area ul li.nospace {
	margin-right:0;
}

.center {
  text-align: center;
}
.coupon_box {
  margin-top: 50px;
}
.coupon li {
  float: left;
  width: 25%;
  list-style: none;
  margin-top: 25px;
}
.coupon li img {
  width: 90%;
  height: auto;
}

.category {
	margin:8px 0;
	padding: 30px 8px;
	background:#374CF0;
	color:white;
	font-size: xx-large;
}



</style>

<style TYPE="text/css">

/*項目選択肢のフォント変更*/
td.inventory font{
	font-size:10px;color:#666666;
	}

</style>



<style type="text/css">
/*項目選択肢の色を変える*/
#rakutenLimitedId_aroundCart table[bgcolor="#CCCCCC"]{
font-family:ヒラギノ角ゴ Pro W3,Hiragino Kaku Gothic Pro,メイリオ,Meiryo,ＭＳ Ｐゴシック,sans-serif;
background:#FFF;
}
#rakutenLimitedId_aroundCart table[bgcolor="#CCCCCC"] td.inventory_choice_name {
background:#777;
padding:10px 5px;
border: 1px solid #555;
}
#rakutenLimitedId_aroundCart table[bgcolor="#CCCCCC"] span.inventory_choice_name {
color:#FFF;
font-size:10px;
letter-spacing:1px;
font-family:ヒラギノ角ゴ Pro W3,Hiragino Kaku Gothic Pro,メイリオ,Meiryo,ＭＳ Ｐゴシック,sans-serif;
}
#rakutenLimitedId_aroundCart table[bgcolor="#CCCCCC"] td.inventory{
background:#EEE;
padding:10px 5px!important;
border: 1px solid #555;
}
#rakutenLimitedId_aroundCart table[bgcolor="#CCCCCC"] td.inventory font{
font-size:10px;
}
</style>









