かわいいミニサイズでペットにピッタリ！！<br>
<br>
ハートの形をした手作りご飯やおやつが<br>
一度に２０個も作れちゃう♪<br>
<br>
オーブン、電子レンジ、冷蔵庫、冷凍庫ＯＫ！<br>
<br>
食洗機にも使えて洗いやすいシリコン製☆彡<br>
<br>
柔らかいのでひっくり返して洗う事も出来るので<br>お手入れも簡単！<br>
<br>
☆基本レシピ付き☆<br>
・フルーツシャーベット　・マッシュポテト&パンプキン<br>
<img src=http://image.rakuten.co.jp/casmin/cabinet/03358934/img61155137.jpg width=150 height=150>
<img src=http://image.rakuten.co.jp/casmin/cabinet/03358934/img61155138.jpg width=150 height=150>
<br><br>
＊その他にもアイディア次第でいろいろ使える<br>
　シリコン型。ペットのご飯やおやつ作りに便利！！<br><br>
■商品サイズ：約200×175×17mm<br>
■容　量：約８ml×２０個<br>
■原料樹脂：シリコン樹脂<br>
■耐熱温度230度／耐冷温度-20度<br>
<br><BR>

